import React from 'react';
import './about.scss';

function about() {
    return (
        <div className="about-me">
            <div className="about-me-paragraphs">
                <p>If you made it this far, congratulations! I'm a software developer with a passion for developing beatiful products that people love! Since graduating from UC Berkeley in 2018, I have been working as a frontend engineer at Salesforce, designed my own clothing line, and have been playing way too much guitar...

                I'm always open to hearing about exciting new projects, to work on so feel free to reach out, or just say hello!</p>
